import styled from "styled-components"
export default function ComprarPlano({img}){
    return(
        <>
        <TopBar>
            <img src={img} alt=""/>
            <p>Driven Plus</p>
        </TopBar>


        </>
    )
}

const TopBar = styled.div`
    display: flex;
    justify-content: center;
    padding: 50px 38px 24px 38px;
    color: #FFFFFF;
    font-weight: 700;
    font-size: 32px;
    line-height: 38px;
`
